import React from 'react';
import styled, { keyframes } from 'styled-components';
import { motion } from 'framer-motion';

const BackgroundContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 0;
  overflow: hidden;
`;

const floatAnimation = keyframes`
  0%, 100% { transform: translateY(0px) rotate(0deg); }
  33% { transform: translateY(-20px) rotate(120deg); }
  66% { transform: translateY(20px) rotate(240deg); }
`;

const pulseAnimation = keyframes`
  0%, 100% { opacity: 0.3; transform: scale(1); }
  50% { opacity: 0.6; transform: scale(1.1); }
`;

const waveAnimation = keyframes`
  0% { transform: translateX(-100%) skewX(12deg); }
  100% { transform: translateX(100vw) skewX(12deg); }
`;

const GradientBackground = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: radial-gradient(ellipse at top, #000814 0%, #001122 25%, #001d3d 50%, #003566 75%, #0353a4 100%);
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: linear-gradient(
      135deg,
      rgba(255, 255, 255, 0.02) 0%,
      rgba(3, 83, 164, 0.05) 25%,
      rgba(0, 29, 61, 0.03) 50%,
      rgba(255, 255, 255, 0.01) 75%,
      rgba(0, 8, 20, 0.8) 100%
    );
  }
  
  &::after {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: 
      radial-gradient(circle at 20% 20%, rgba(255, 255, 255, 0.1) 0%, transparent 50%),
      radial-gradient(circle at 80% 80%, rgba(3, 83, 164, 0.15) 0%, transparent 50%),
      radial-gradient(circle at 40% 60%, rgba(0, 29, 61, 0.1) 0%, transparent 50%);
  }
`;

const FloatingOrb = styled(motion.div)`
  position: absolute;
  border-radius: 50%;
  filter: blur(60px);
  animation: ${floatAnimation} 20s ease-in-out infinite;
`;

const PulsingOrb = styled(motion.div)`
  position: absolute;
  border-radius: 50%;
  filter: blur(80px);
  animation: ${pulseAnimation} 8s ease-in-out infinite;
`;

const WaveElement = styled.div`
  position: absolute;
  width: 200%;
  height: 100px;
  background: linear-gradient(90deg, 
    transparent 0%, 
    rgba(255, 255, 255, 0.03) 25%, 
    rgba(3, 83, 164, 0.08) 50%, 
    rgba(255, 255, 255, 0.03) 75%, 
    transparent 100%
  );
  animation: ${waveAnimation} 15s linear infinite;
  transform: skewX(12deg);
`;

const Wave1 = styled(WaveElement)`
  top: 20%;
  animation-delay: 0s;
`;

const Wave2 = styled(WaveElement)`
  top: 60%;
  animation-delay: -5s;
  opacity: 0.6;
`;

const Wave3 = styled(WaveElement)`
  top: 80%;
  animation-delay: -10s;
  opacity: 0.4;
`;

const Orb1 = styled(FloatingOrb)`
  width: 400px;
  height: 400px;
  background: radial-gradient(circle, rgba(255, 255, 255, 0.1) 0%, rgba(3, 83, 164, 0.2) 50%, transparent 100%);
  top: -10%;
  left: -15%;
  animation-delay: 0s;
`;

const Orb2 = styled(PulsingOrb)`
  width: 300px;
  height: 300px;
  background: radial-gradient(circle, rgba(3, 83, 164, 0.15) 0%, rgba(0, 29, 61, 0.1) 50%, transparent 100%);
  top: 50%;
  right: -5%;
  animation-delay: -3s;
`;

const Orb3 = styled(FloatingOrb)`
  width: 250px;
  height: 250px;
  background: radial-gradient(circle, rgba(255, 255, 255, 0.08) 0%, rgba(0, 29, 61, 0.12) 50%, transparent 100%);
  bottom: 10%;
  left: 20%;
  animation-delay: -6s;
`;

const Orb4 = styled(PulsingOrb)`
  width: 180px;
  height: 180px;
  background: radial-gradient(circle, rgba(3, 83, 164, 0.12) 0%, rgba(255, 255, 255, 0.05) 50%, transparent 100%);
  top: 25%;
  right: 25%;
  animation-delay: -2s;
`;

const GeometricShape = styled(motion.div)`
  position: absolute;
  opacity: 0.1;
  filter: blur(1px);
`;

const Triangle = styled(GeometricShape)`
  width: 0;
  height: 0;
  border-left: 30px solid transparent;
  border-right: 30px solid transparent;
  border-bottom: 50px solid rgba(255, 255, 255, 0.1);
  top: 30%;
  left: 70%;
  animation: ${floatAnimation} 25s ease-in-out infinite;
  animation-delay: -8s;
`;

const Diamond = styled(GeometricShape)`
  width: 40px;
  height: 40px;
  background: rgba(3, 83, 164, 0.1);
  transform: rotate(45deg);
  top: 70%;
  left: 15%;
  animation: ${floatAnimation} 18s ease-in-out infinite;
  animation-delay: -12s;
`;

const Circle = styled(GeometricShape)`
  width: 60px;
  height: 60px;
  border: 2px solid rgba(255, 255, 255, 0.08);
  border-radius: 50%;
  top: 15%;
  right: 15%;
  animation: ${pulseAnimation} 12s ease-in-out infinite;
  animation-delay: -4s;
`;

function Background() {
  return (
    <BackgroundContainer>
      <GradientBackground />
      
      {/* Animated Waves */}
      <Wave1 />
      <Wave2 />
      <Wave3 />
      
      {/* Floating Orbs */}
      <Orb1
        animate={{
          x: [0, 30, -20, 0],
          y: [0, -25, 15, 0],
        }}
        transition={{
          duration: 20,
          repeat: Infinity,
          ease: "easeInOut"
        }}
      />
      
      <Orb2
        animate={{
          x: [0, -40, 25, 0],
          y: [0, 20, -30, 0],
        }}
        transition={{
          duration: 25,
          repeat: Infinity,
          ease: "easeInOut"
        }}
      />
      
      <Orb3
        animate={{
          x: [0, 20, -15, 0],
          y: [0, -15, 25, 0],
        }}
        transition={{
          duration: 22,
          repeat: Infinity,
          ease: "easeInOut"
        }}
      />
      
      <Orb4
        animate={{
          x: [0, -25, 35, 0],
          y: [0, 30, -20, 0],
        }}
        transition={{
          duration: 18,
          repeat: Infinity,
          ease: "easeInOut"
        }}
      />
      
      {/* Geometric Shapes */}
      <Triangle />
      <Diamond />
      <Circle />
    </BackgroundContainer>
  );
}

export default Background;
